const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Archer</li><li>True Name: William Tell</li><li>Gender: Male</li><li>Source: \u300EWilliam Tell\u300F</li><li>Origin: Switzerland</li><li>Alignment: Lawful Good</li><li>Height: 175 cm</li><li>Weight: 69 kg</li></ul><p><strong>Meta</strong></p><ul><li>Scenario writer: Minase Hadzuki</li><li>Character designer: Takahashi Keitar\u014D</li><li>CV: Fujii Hayato</li><li>Appearance in Main Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">B</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: [D]</strong></p><p>Invalidates spells of one stage (Single Action).<br> The level of Magic Resistance of an amulet that repels magecraft.</p><p><strong>Independent Action: [A]</strong></p><p>A skill that represents how he can manifest for a long time even in absence of a Master or without mana supply.<br> If it\u2019s in a situation inside the mountains, and waiting motionlessly for his prey without moving, the effect rises more.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Hunter of Uri: [B]</strong></p><p>The techniques of hunting he learned while living with the nature in the province of Uri, currently in central Switzerland.<br> What lies at the basis of the widely known famous hunter.<br> Compositely includes several skills and techniques related to hunting such as obviously treatment of the crossbow, good visual acuity, the ability to grasp the target with the eyesight, creation of traps, their adequate installation\u2026 and so forth.<br> In the mountains of Uri it\u2019s equivalent to EX.<br> If he takes time to get used to mountains he doesn\u2019t know, the skill rank rises substantially.</p><p><strong>Unwavering Patience: [C]</strong></p><p>Waiting for the prey still and without moving when it\u2019s cold or when it\u2019s hot, with a patience like a huge rock.<br> The reason why this skill is separated while parts of it are contained within the 1st skill is because this patience is the basis of a lifestyle of him providing for his family in a rustic way that goes along with nature and not having a gaudy life, and because according to legend he used this for other things besides hunting.<br> After the incident of the apple on his son\u2019s head, he lurked patiently in the mountains, and waited for the evil governor to cross a defile.<br> Everything until now, and everything from now on. What should be done, and what must be done.<br> While thinking about that, he kept waiting, still, still \u2014\u2014\u2014.</p><p><strong>Aiming: [EX]</strong></p><p>A skill that represents the ability to take aim with projectiles.<br> Ability to concentrate as the hunter who ran through the mountains of Uri. Can even shoot through the apple placed on top of his son\u2019s head.<br> In addition to the high concentration to put even breathing and heartbeats under perfect control, by perfectly adapting them to the environment of the external world without being noticed,<br> he doesn\u2019t \u300Chit\u300D, but gets the result of \u300Cnaturally hitting\u300D.<br> This is said to be connected to the spirituality of Japanese archery in Orient.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="apfel-schie\xDFen-released-first-arrow-of-faith" tabindex="-1"><a class="header-anchor" href="#apfel-schie\xDFen-released-first-arrow-of-faith" aria-hidden="true">#</a> Apfel Schie\xDFen: Released first arrow of faith</h1><ul><li>Rank: C</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: 1~50</li><li>Maximum number of targets: 1 person</li></ul><p>Apfel Schie\xDFen.<br> The reading means \u300EShooting the apple\u300F.<br> The legendary arrow shot with a crossbow that admirably pierced the apple placed on top of his son\u2019s head.<br> This arrow released after receiving the trust on the son\u2019s father will never fail, and will \u300Ecertainly\u300F pierce the target.<br> Summarizing, this Noble Phantasm has the property of interfering with the law of cause and effect, and evasion is fundamentally impossible.</p><h1 id="zweite-schie\xDFen-released-second-best-second-arrow" tabindex="-1"><a class="header-anchor" href="#zweite-schie\xDFen-released-second-best-second-arrow" aria-hidden="true">#</a> Zweite Schie\xDFen: Released second best second arrow</h1><ul><li>Rank: C+</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: 1~50</li><li>Maximum number of targets: 1 person</li></ul><p>Zweite Schie\xDFen.<br> A second Noble Phantasm that is activated only supposing the case in which the first Noble Phantasm that \u300Ewill never fail\u300F misses.<br> It\u2019s derived from the anecdote in which Tell, thinking on what would happen if he missed the apple on his son, had a hidden arrow in order to shoot at the evil governor Ge\xDFler.<br> This arrow is released at the same time \u300Eit must be shot in the case of the first arrow missing\u300F.<br> That means this arrow is a Noble Phantasm that is conceptually overlapped and exists multiple times.<br> If the first arrow hits properly it will never be activated.</p><p>As if he was saying \u300EIf I miss the apple on top of my son\u2019s head (the first shot) everyone will die, so I have to shoot at the governor that gave that order (second shot) if I fail\u300F, depending on the situation it can be released deciding where to shoot it at.<br> It\u2019s possible to choose the same target as the first shot as well, and it will certainly pierce the target by interfering with the law of cause and effect in the same manner.<br> However it\u2019s hard to fire randomly since the mana consumption becomes intenser.<br> \u2026 Although the situation in which \u300Ethe first arrow that will absolutely hit\u300F fails is not frequently seen.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><p>First person pronouns: \u308F\u3057 (washi)<br> Second person pronouns: \u304A\u307E\u3048\u3055\u3093 (omae-san)<br> Third person pronouns: \u3084\u3064 (yatsu)</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>A hunter that lives together with nature.<br> The simple and virile disposition to love his family.<br> He doesn\u2019t really like doing flashy or pompous things.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>He doesn\u2019t really have a wish for the Holy Grail.<br> But if there was something he would wish for,<br> he would seek \u300Ea world in which his family can live happily\u300F.</p><p>He treats the Master as he normally would treat a Master.<br> But if it\u2019s someone he has taken a liking to, he may see them as his son \xB7 daughter.<br> In that case, he would try to guide the Master to the righteous path as much as he could, and scold them when they make a mistake.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u300CDid you call? My name\u2019s William Tell. You don\u2019t seem to have the kind of face\u2026<br> to ask me to shoot some beasts at the forest. Good grief\u2026\u300D</p><p>\u300CI\u2019d like you to know. That the evil governor\u2019s heart and the apple above my head\u2019s son weren\u2019t fun to shoot at. \u2026If I got in the same situation again, I don\u2019t know if I could do the same thing\u300D</p><p>\u300CWow, a mythological hunter? If there\u2019s a chance I\u2019d like both of us to go to the mountains.<br> It\u2019d be nice to show that the Hunter of Uri\u2019s skill is nothing to sneeze at\u2026\u300D</p><p>\u300CHehhe, I actually like new stuff. Whether it is for hunting or not, I surprisingly accept what I think it\u2019s good easily. I\u2019m fond of this crossbow and these clothes, and tobacco\u2026 Ah, having one smoke after finishing a hunt feels delicious\u2026\u300D</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>William Tell (Wilhelm Tell in local Swiss German)<br> is a legendary character who lived at Uri, central Switzerland, in the late 13th century ~ early 14th century.<br> His name was popularized as a character appearing on a drama, but for the people of Switzerland,<br> he is accepted as a hero that symbolizes the nation building movement.</p><p>The region of Switzerland at that time was in a spot in which three provinces signed an alliance for their autonomous independence from the Habsburg family,<br> and created the base form of the later Swiss Federation.<br> In one of these provinces, Uri, lived an Austrian governor called Hermann Ge\xDFler.<br> He erected a pole on the central square and hung his hat on it, and forced the residents that passed in front of it to<br> bow their heads and pay respect to that hat.</p><p>But Tell, who passed in front of the hat together with his son, was arrested since he didn\u2019t bow his head.<br> Ge\xDFler told Tell, who was an expert with the crossbow, \u300CIf you can pierce an apple placed on the top of your son\u2019s head I will forgive you\u300D.<br> The young son refused to be tied up or blindfolded, and headed on his own accord to the trunk of a linden tree.<br> \u300CWhy do I need to be scared? I trust on my father\u2019s skill. Come on Dad, show him\u300D.<br> And so Tell splendidly pierced the apple above his son\u2019s head thanks to that trust,<br> and the released father and child gave each other a tight hug.</p><p>Immediately after.<br> At the moment of shooting the apple, Ge\xDFler noticed that Tell had hidden another arrow in his pocket apart from the one nocked on his crossbow.<br> Ge\xDFler asked for the meaning of that arrow.<br> Then he announced \u300CHad the first arrow pierced something other than the apple, I intended to kill you with this arrow\u300D<br> A wrathful Ge\xDFler arrested him again, and tried to drag him away from the country.<br> But Tell succeeded in escaping halfway and survived.</p><p>And \u2014\u2014\u2014 In order to escape from the governor\u2019s revenge, in order to protect his sons from the governor\u2019s rage,<br> Tell did what he had to do.<br> Tell sniped Ge\xDFler, who was riding a horse at a narrow defile, and pierced his heart.</p><p>The town that lost its tyrant returned to peace, Tell was praised as a hero,<br> and starting from this case, the momentum of the Swiss independent movement became increasingly stronger \u2014\u2014\u2014.</p><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>Just like the play depicts him, he\u2019s a man with the courage to face the oppressors that make the people suffer.<br> But he wasn\u2019t driven by a political \xB7 national sense of danger, if anything his motives were personal.<br> As a hunter, as a father, as a man.<br> As a result of doing what he had to do, he became a warrior of justice.<br> That means he became a realistic hero.<br> A sometimes shallow, sometimes warm, and scary when angry man that has the boldness and composure to protect his family, as if he embodied the concept of \u300Efathers are heroes\u300F itself.</p><h2 id="standard-weapons" tabindex="-1"><a class="header-anchor" href="#standard-weapons" aria-hidden="true">#</a> Standard Weapons</h2><p>Crossbow.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Atalante</strong></p><p>A hunter of mythology.<br> Of course the speed of legs is important, but\u2026 Hunting isn\u2019t only that.<br> In the case they had a duel, he\u2019ll show her how it\u2019s done.</p><p><strong>Super Orion</strong></p><p>A hunter of mythology.<br> Of course raw strength is extraordinarily important, but\u2026Hunting isn\u2019t only that.<br> In the case they had a duel, he\u2019ll show him how it\u2019s done.</p><p><strong>Yagy\u016B Munenori</strong></p><p>Smoking room mates. Their dad talks may get lively.<br> His son seemed to be quite eccentric\u2026</p><p><strong>Sakata Kintoki</strong></p><p>Smoking room mates.<br> The gimmicks of the clattered crossbow are quite Golden, it seems.</p><p><strong>Young men-type Servants</strong></p><p>He looks at them with pleasant eyes.<br> But putting them together with an apple is not good, absolutely.</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>William Tell-san\u2019s image was \u300CMoriz\u014D\u300D[1]. But, searching again Moriz\u014D is a quite monochrome green, it didn\u2019t have multi-cam camouflage. William Tell-san couldn\u2019t be that green\u2026! He had the image of an austere father from the beginning, but I thought \u300CIs it too funky?\u300D when I painted his hair pink in a rush so I dropped the colorfulness. (Takahashi Keitar\u014D)</p><h2 id="tl-notes" tabindex="-1"><a class="header-anchor" href="#tl-notes" aria-hidden="true">#</a> TL Notes:</h2>', 65);
